class DataPost {  DataPost({      this.title,       this.description,       this.userId,       this.image,       this.categoryId,       this.phone,       this.detailsAddress,       this.country,       this.startDate,       this.endDate,       this.idImage,      this.startTime,      this.endTime,       this.id,});  DataPost.fromJson(dynamic json) {    title = json['title'];    description = json['description'];    userId = json['user_id'];    image = json['image'];    idImage = json['id_image'];    categoryId = json['category_id'];    phone = json['phone'];    detailsAddress = json['details_address'];    country = json['country'];    startDate = json['start_date'];    endDate = json['end_date'];    startTime = json['start_time'];    endTime = json['end_time'];    id = json['id'];  }  String? title;  String? description;  int? userId;  String? image;  String? categoryId;  String? phone;  String? detailsAddress;  String? country;  String? startDate;  String? endDate;  String ?startTime;  String? endTime;  String? idImage;  int? id;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['title'] = title;    map['description'] = description;    map['user_id'] = userId;    map['image'] = image;    map['category_id'] = categoryId;    map['id_image'] = idImage;    map['phone'] = phone;    map['details_address'] = detailsAddress;    map['country'] = country;    map['start_date'] = startDate;    map['end_date'] = endDate;    map['start_time'] = startTime;    map['end_time'] = endTime;    map['id'] = id;    return map;  }}